import { Button } from "react-bootstrap";
import { Link } from "react-router-dom";
import React from "react";

function MyWallets() {

  return (
    <Link as={Button} to="/wallet/create" variant="primary">
      Generate new wallet
    </Link>
  );
}

export default MyWallets;
